import { Link } from "react-router-dom";

function EventsPage() {
  const DUMMY_PAGE = [
    { id: "p1", title: "Page1" },
    { id: "p2", title: "Page2" },
    { id: "p3", title: "Page3" },
  ];

  return (
    <>
      <ul>
        {DUMMY_PAGE.map((page) => (
          <li key={page.id}>
            <Link to={`/events/${page.id}`}>{page.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
}

export default EventsPage;
